    const id = searchParams.get("id");

    const mode = searchParams.get("mode");

    console.log(`id: ${id}`);
    console.log(`mode : ${mode}`);

    return (
        <>
            <div>Edit</div>
            <button onClick={() => setSearchParams()}>바꾸기</button>
        </>
    );
};

export default Edit;
